import React, { Fragment } from 'react'

export default function Dice(props) {

  const { diceItem } = props;

  return (
    <Fragment>
      <img className="ml-3" style={{ width: 50 }} src={diceItem.pic} alt={diceItem.id} />
    </Fragment>
  )
}
